import React, { Component } from "react";
import { StyleSheet, View, Image, ImageBackground } from "react-native";
import CupertinoButtonPurple from "../components/CupertinoButtonPurple";

function LandingPage(props) {
  return (
    <View style={styles.container}>
      <View style={styles.imageStack}>
        <Image
          source={require("../assets/images/image_Imh0..png")}
          resizeMode="contain"
          style={styles.image}
        ></Image>
        <ImageBackground
          source={require("../assets/images/image_ix80..png")}
          resizeMode="contain"
          style={styles.image2}
          imageStyle={styles.image2_imageStyle}
        >

          <CupertinoButtonPurple
            style={styles.cupertinoButtonPurple}
          ></CupertinoButtonPurple>


        </ImageBackground>
        <Text style={styles.nemasEsteUcet}>Nemáš ešte účet ?</Text>

      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1
  },
  image: {
    position: "absolute",
    top: 100,
    height: 409,
    width: 368,
    left: 193
  },
  image2: {
    position: "absolute",
    top: 0,
    left: 0,
    height: 812,
    width: 775
  },
  image2_imageStyle: {},
  cupertinoButtonPurple: {
    height: 74,
    width: 187,
    marginTop: 641,
    marginLeft: 288
  },
  imageStack: {
    width: 775,
    height: 812,
    marginLeft: -193
  }
});

export default LandingPage;
